import Link from 'next/link'
import Logo from '../components/Logo'

const Navbar = () => (
    <nav class="navbar navbar-light bg-light" style="background-color: #e3f2fd">
        <a class="navbar-brand" href="#">
            <Logo/>
        </a>
    </nav>
)

export default Navbar;
